export const dailyHistory = (() => {
  const formatted = [];
  history.forEach(item => {
    formatted.push(item.daily.data[0]);
  });
  return formatted;
})();

export const formattedHistory = (() => {
  const formatted = [];
  dailyHistory.forEach(day => {
    let avgTemp = (day.temperatureMax + day.temperatureMin) / 2;
    avgTemp = avgTemp.toPrecision(4);
    const humidity = Math.floor(day.humidity * 100);
    const date = new Date(day.dateTime);
    const weekday = weekdays[date.getDay()];
    formatted.push({
      name: weekday,
      temp: avgTemp,
      humidity: humidity,
      date: date.toDateString(),
      dateObj: date,
      icon: day.icon,
      summary: day.summary,
     });
  });
  return formatted.sort((a, b) => {
    if (a.dateObj < b.dateObj) {
      return -1;
    } else if (a.dateObj > b.dateObj) {
      return 1;
    } else {
      return 0;
    }
  });
})();
